function ExpenseItem(props) {
  //   const expenseItem = new Date(2021, 2, 28);
  //   const expensetITLE = "Car Insurence";
  //   const expenseAmount = 294.76;

  return (
    <div className="expens-item">
      <div>{props.date.toISOString()}</div>
      <div className="expens-item-description">
        <h2>{props.title}</h2>
        <div className="expens-item-price">${props.amount}</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
